import React, { useEffect } from 'react';
//import { Link, withRouter } from 'react-router-dom';
import { getData } from '../actions/data';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';

const DataView = ({ data, getData }) => {
	useEffect(() => {
		getData();
	}, [getData]);

	const results = data.data;

	if (results !== null) {
		results.map(items => {
			const news = items.data.response;
			if (news !== null || undefined) {
				console.log(news);
				//console.log(Object.entries(items.data.response));
				// const nytNews = items.data.results;
				// const gaurdNews = items.data.response;
				// console.log(nytNews, gaurdNews)
			}
		});
	}

	// const dataObj = Object.entries(data.data);

	return <h1 onClick={getData}>Reader</h1>;
};

DataView.propTypes = {
	DataView: PropTypes.func.isRequired,
	data: PropTypes.object.isRequired
};

const mapStateToProps = state => ({
	data: state.data
});

export default connect(mapStateToProps, { getData })(DataView);
